import './App.css';
import ExpenseItem from './components/ExpenseItem';

function App() {
  let expenses = [
    {
      id: 'e1',
      title: 'Rent charges',
      amount: 6000,
      date: new Date(2002,5,3),
    },
    {
      id: 'e2',
      title: 'party expenses',
      amount: 3000,
      date: new Date(2023,4,12),
    },
    {
      id: 'e3',
      title: 'food charges',
      amount: 5000,
      date: new Date(2023,9,15),
    },
    {
      id: 'e4',
      title: 'girlfriend expenses',
      amount: 3000,
      date: new Date(2001,2,20),
    },

  ];

  return (
    <div className='totali'>
      <h1 className='heading'>Total Expenses</h1>
      <ExpenseItem 
       date =  {expenses[0].date}
       title = {expenses[0].title}
       coste = {expenses[0].amount}>
       </ExpenseItem>

       <ExpenseItem 
       date =  {expenses[1].date}
       title = {expenses[1].title}
       coste = {expenses[1].amount}>
       </ExpenseItem>

       <ExpenseItem 
       date =  {expenses[2].date}
       title = {expenses[2].title}
       coste = {expenses[2].amount}>
       </ExpenseItem>

       <ExpenseItem 
       date =  {expenses[3].date}
       title = {expenses[3].title}
       coste = {expenses[3].amount}>
       </ExpenseItem>

    </div>

  );
}

export default App;
